import React, { Component } from 'react';
import Navbar from 'react-bootstrap/Navbar'
import Nav from 'react-bootstrap/Nav'
import './NavBer.css'
import logo from '../images/logo.png'




class NavBer extends Component {
    render() {
        return (
             
   <div className="Navbar">
  <Navbar bg="dark" variant="dark">
    
    <Navbar.Brand href="#home" style={{color:"whitesmoke"}}>COVIT-19 SURVEY FORM</Navbar.Brand>
    <Nav className="NavLink">
      
      <Nav.Link href="#home"style={{color:"white"}}>Home</Nav.Link>
      <Nav.Link href="#survey"style={{color:"white"}}>Survey</Nav.Link>
      <Nav.Link href="#liveStats"style={{color:"white"}}>COVIT-19 Live Stats</Nav.Link>
      <Nav.Link href="#about"style={{color:"white"}}>About Us</Nav.Link>
      <Nav.Link href="#login"style={{color:"white"}}>Login</Nav.Link>
      <Nav.Link href="#registration"style={{color:"white"}}>Registration Now</Nav.Link>

      
    </Nav>
    
  </Navbar>
 
  <img src={logo} alt="Logo" style={{
      height:"100px",
      width:"250px"

  }}/>

 

  <div/>
            </div>
        );
    }
}

export default NavBer;
